export default function createButtonState(buttonsArray, style) {
  return buttonsArray.map(x => buttons[x] === style.profileButton)

  let buttons = {}

  buttonsArray.forEach((item, i) => {
    buttons[i] = style.profileButton
  })
  
  return buttons
}
